// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title ExxaTop10Fund
 * @dev Smart contract to manage a Top 10 Crypto Fund for Exxa Finance
 */
contract ExxaTop10Fund {
    address public manager;
    uint256 public totalShares;
    uint256 public totalFundValueUSD;

    address public exxaToken;
    address public stablecoin;

    mapping(address => uint256) public userShares;
    mapping(address => uint256) public pendingWithdrawals;

    event Deposited(address indexed user, uint256 amountUSD, uint256 sharesIssued);
    event WithdrawalRequested(address indexed user, uint256 shares);
    event WithdrawalCompleted(address indexed user, uint256 amountUSD);
    event FundValuationUpdated(uint256 totalValueUSD);
    event AssetsRebalanced(string[] assetSymbols, uint256[] allocations);
    event AutoInvested(string[] selectedAssets);

    modifier onlyManager() {
        require(msg.sender == manager, "Not authorized");
        _;
    }

    constructor(address _exxaToken, address _stablecoin) {
        manager = msg.sender;
        exxaToken = _exxaToken;
        stablecoin = _stablecoin;
    }

    function depositWithStablecoin(uint256 amountUSD) external {
        require(amountUSD > 0, "Amount must be greater than 0");
        IERC20(stablecoin).transferFrom(msg.sender, address(this), amountUSD);

        uint256 shares = totalShares == 0 ? amountUSD : (amountUSD * totalShares) / totalFundValueUSD;
        userShares[msg.sender] += shares;
        totalShares += shares;
        totalFundValueUSD += amountUSD;

        emit Deposited(msg.sender, amountUSD, shares);
    }

    function depositWithExxa(uint256 amountUSD) external {
        require(amountUSD > 0, "Amount must be greater than 0");
        IERC20(exxaToken).transferFrom(msg.sender, address(this), amountUSD);

        uint256 shares = totalShares == 0 ? amountUSD : (amountUSD * totalShares) / totalFundValueUSD;
        userShares[msg.sender] += shares;
        totalShares += shares;
        totalFundValueUSD += amountUSD;

        emit Deposited(msg.sender, amountUSD, shares);
    }

    function requestWithdrawal(uint256 shares) external {
        require(userShares[msg.sender] >= shares, "Insufficient shares");
        userShares[msg.sender] -= shares;
        pendingWithdrawals[msg.sender] += shares;

        emit WithdrawalRequested(msg.sender, shares);
    }

    function processWithdrawal(address user, uint256 usdAmount, address tokenOut) external onlyManager {
        require(tokenOut == stablecoin || tokenOut == exxaToken, "Invalid token");

        uint256 sharesToBurn = (usdAmount * totalShares) / totalFundValueUSD;
        require(pendingWithdrawals[user] >= sharesToBurn, "Not enough pending shares");

        pendingWithdrawals[user] -= sharesToBurn;
        totalShares -= sharesToBurn;
        totalFundValueUSD -= usdAmount;

        emit WithdrawalCompleted(user, usdAmount);

        IERC20(tokenOut).transfer(user, usdAmount);
    }

    function updateFundValuation(uint256 newTotalValueUSD) external onlyManager {
        totalFundValueUSD = newTotalValueUSD;
        emit FundValuationUpdated(newTotalValueUSD);
    }

    function rebalanceAssets(string[] calldata assetSymbols, uint256[] calldata allocations) external onlyManager {
        require(assetSymbols.length == allocations.length, "Mismatched inputs");
        emit AssetsRebalanced(assetSymbols, allocations);
    }

    function getUserShareValue(address user) public view returns (uint256) {
        return (userShares[user] * totalFundValueUSD) / totalShares;
    }

    /**
     * @notice Invests in the top 9 tokens by market cap and volume
     * @dev Requires Hyperliquid integration via off-chain backend calling this function
     * Emits selected asset names
     */
    function autoInvestTop9(string[] calldata selectedAssets) external onlyManager {
        require(selectedAssets.length == 9, "Must provide exactly 9 assets");

        // Example: selectedAssets = ["BTC", "ETH", ...] sorted by volume and market cap from Hyperliquid API backend
        // Integration assumed to be off-chain calling this contract

        emit AutoInvested(selectedAssets);

        // Add actual investment logic here (off-chain or via further on-chain abstraction)
    }
}

interface IERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
}

